import axiosServices from "./axiosServices";
import {API_ENDPOINT} from "../../Common/constants/index";

export const dungluong=(url)=>{
    return axiosServices.get(API_ENDPOINT+url);
};

export const mausac=(url)=>{
    return axiosServices.get(API_ENDPOINT+url);
};

export const xemgiatheodungluongvamausac=(dungluong, mausac)=>{
    return axiosServices.get(`${API_ENDPOINT}/xemgia?dungluong=${dungluong}&mausac=${mausac}`);
};
